import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { handleSuccess, handleError, ToastContainer } from '../utils/ReactToastify';
import '../utils/ReactToastifyCustom.css';

function FindUserForgotPassword() {
    const [emailOrUsername, setEmailOrUsername] = useState('');
    const [user, setUser] = useState(null);
    const [loading, setLoading] = useState(false);
    const [fadeIn, setFadeIn] = useState(false);
    const [showContent, setShowContent] = useState(false);
    const navigate = useNavigate();

    useEffect(() => {
        if (fadeIn) {
            const timeoutId = setTimeout(() => {
                setFadeIn(false);
            }, 500);
            return () => clearTimeout(timeoutId);
        }
    }, [fadeIn]);

    useEffect(() => {
        if (loading) {
            const timerId = setTimeout(() => {
                setShowContent(true);
            }, 500); // Show content after 2 seconds
            return () => clearTimeout(timerId);
        } else {
            setShowContent(true); // Ensure content is shown if loading is false
        }
    }, [loading]);

    const handleSearch = async (event) => {
        event.preventDefault();
        setLoading(true);
        setShowContent(false); // Hide content while loading

        try {
            const response = await fetch('http://localhost:8080/auth/forgot-password/find-user', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ emailOrUsername }),
            });

            const result = await response.json();

            // Delay setting user state for 2 seconds to show loading spinner
            setTimeout(() => {
                if (response.ok) {
                    handleSuccess(result.message);
                    setUser(result.user);
                } else {
                    handleError(result.message);
                    setUser(null);
                }
                setFadeIn(true);
                setLoading(false);
            }, 500);
        } catch (err) {
            handleError('Network error. Please check your connection and try again.');
            setFadeIn(true);
            setLoading(false);
        }
    };

    const handleProceed = () => {
        if (user) {
            navigate('/forgot-password/send-otp', { state: { email: user.email } });
        }
    };

    return (
        <div className="find-user-container container">
            <h1>Forgot Password</h1>
            <form onSubmit={handleSearch}>
                <div className="input-wrapper">
                    <input
                        type="text"
                        placeholder="Email or Username"
                        value={emailOrUsername}
                        onChange={(e) => setEmailOrUsername(e.target.value)}
                        required
                    />
                    <button type="submit" disabled={loading} className="search-icon">
                        <i className="fa fa-search"></i>
                    </button>
                </div>
            </form>

            <div className="found-user-container ">

                {loading && !showContent ? (
                    <div className="loading-overlay">
                        <img src='/apple-loading.gif' alt='Loading...' className='loading-spinner' />
                    </div>
                ) : (
                    <div className={`found-user-content ${fadeIn ? 'fade-in' : ''}`}>
                        {user ? (
                            <div
                                className="user-info-to-forgot-password"
                                onClick={handleProceed}
                                style={{ cursor: 'pointer' }}
                            >
                                <div className="devof-user-info-to-forgot-password">
                                    <img src={user.profilePicture} alt="Profile" />
                                </div>
                                <div className="devof-user-info-to-forgot-password">
                                    <h3>{user.name}</h3>
                                    <p>{user.username}</p>
                                </div>
                            </div>
                        ) : (
                            <div className="user-info-placeholder-massage">
                                <p>Search your Account by Email Or Username.</p>
                            </div>
                        )}
                    </div>
                )}
            </div>

            <ToastContainer />
        </div>
    );
}

export default FindUserForgotPassword;
